snippet.textDisplay:
@Marginal Gamer ae fala isso pra uma pessoa que está sofrendo, morrendo com falta de ar acamado em um leito de hospital isolado, longe da família então😡.... 

É saber que sua vida depende de médicos para encontrar a cura isso é realmente muito triste.

Vc fala isso porque não é com alguém de sua família que vc ama que está morrendo com essa doença horrível em um hospital sem recursos.... Sabendo que a qualquer hora eles podem morrer.... É muitas vezes pessoas jogadas em um corredor de hospital....

